import React from 'react'

const Banner = () => {
    return (
        <div>
            <div className="w-10">
                <img src="https://www.namu.com.vn/img/uploads/slider/slishow-1583381669-BANNER_NAMU_1348W%20X%20572H.jpg" />
            </div>
        </div>
    )
}


export default Banner
